import React from "react";

function Navbar() {
  const tabStyle = {
    float: "center",
    width: "33.3%",
    padding: "10",
  };

  return (
    <div className="navbar-container">
      <h1 style={tabStyle}>Home</h1>
      <h1 style={tabStyle}>About</h1>
      <h1 style={tabStyle}>Portfolio</h1>
    </div>
  );
}

export default Navbar;
